import { Grid, TextField, Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles'
import React from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { RestaurantServings } from '../../actions/RestaurantActions';

function RestProfileScreen(props) {

    const dispatch = useDispatch()
    const restaurantServings = useSelector(state => state.restaurantServings)
    console.log(restaurantServings?.servings)
    const restInfo = JSON.parse(localStorage.getItem('userInfo'))
    console.log(restInfo)
    React.useEffect(() => {
        dispatch(RestaurantServings(JSON.parse(localStorage.getItem('userInfo')).id))
        if(props.match.params.id != restInfo.id){
            props.history.push('/rest/profile/'+restInfo.id)
        }
    }, [dispatch])


    const useStyles = makeStyles(theme => ({
        heading:{
            ...theme.typography.content,
            fontSize : '2.5rem',
            textAlign : 'center'
        },
        formDiv:{ display: 'flex', alignItems: 'center',justifyContent:'center' }
    }))
    const classes = useStyles()
    return (
        <div>
            <h1 className={classes.heading} >My servings</h1>
            <div >
                <div style={{ display: 'flex', alignItems: 'center' }} >
                    <Typography>Name :</Typography><TextField disabled={true} placeholder={restInfo.name} />
                </div>
            </div>
            {/* {restaurantServings?.servings?.map(item => {
                return (
                    <Grid xs={12} container >
                        <Grid item xs={12} md={} >

                        </Grid>
                    </Grid>
                )
            })} */}
        </div>
    )
}

export default RestProfileScreen
